import React from 'react';
import Todos from './components/Todos';
import './App.css';

function App() {
  state = {
    todos: [
      {
        id: 1,
        title: 'Finish React JS Crash Course by Traversy',
        completed: false
      },
      {
        id: 2,
        title: 'Make a weather toolbar for Deer Web app using React',
        completed: false
      },
      {
        id: 3,
        title: 'Commit Todo to my github repository',
        completed: false
      }
    ]
  }
  return (
    <div className="App">
      <h1>ToDo App</h1>
      <Todos />
    </div>
  );
}

export default App;
